import React, { useEffect, useState } from "react";
import { useSelector, useDispatch } from 'react-redux';
import { useNavigate } from 'react-router-dom';
import Header from '../Header/Header.jsx';
import Footer from '../Footer/Footer.jsx';
import './NumbersTrainPage.css';
import { vocabulary } from "../../utils/constants.js";
import arrow from '../../images/arrow2.png';
import { removeCurrentDeck } from '../../services/actions/currentDeck.js';

function NumbersTrainPage() {

  const navigate = useNavigate();
  const dispatch = useDispatch();
  const [words, setWords] = useState([]);
  const [wordsAreVisible, setWordsAreVisible] = useState(true);
  const [cardsAreVisible, setCardsAreVisible] = useState(false);
  const [repeatMode, setRepeatMode] = useState(false);
  const { currentDeck } = useSelector(state => state.currentDeckReducer);

  useEffect(()=> {
    let aaa;
    if (currentDeck !== null) {
      aaa = vocabulary.filter(item => item.ruTopic.includes(currentDeck.ruTopic));
      setWords(aaa);
    }
  }, [currentDeck])

  useEffect(()=> {
    console.log(words)
  }, [words])

  function handleClick() {
    dispatch(removeCurrentDeck());
    navigate(`/`);
  }

  function handleCloseModesClick() {
    setWordsAreVisible(true);
    setCardsAreVisible(false);
    setRepeatMode(false);
  }

  function handleRepeatModeClick() {
    setWordsAreVisible(false);
    setRepeatMode(true);
  }

  function handleCardsModeClick() {
    setCardsAreVisible(true);
  }

  return (
    <>
      <Header />
      <main className="main__content1">
        <section className="deckItem__content">
          <div className="deckItem__title-container">
            <h1 className="deckItem__title">
              Запоминаем числа
            </h1>
            <div className="deckItem__title-container1" onClick={handleClick}>
              <img 
                src={arrow} 
                alt="Стрелка назад" 
                className='deckItem__arrow'
              />
              <p className="deckItem__text">На главную</p>
            </div>
          </div>
          <div className='cardsHolder__form'>
        <div>
          {word()}
        </div>
        <input 
          placeholder="Место для слова" 
          value={repeatingForm.word} 
          id='cardsHolderRepeatingInput'
          type="text"
          name="word" 
          onChange={onRepeatChange}
          required
          className='cardsHolder__input'
          autoComplete="off"
          autocorrect="off" 
          autocapitalize="off" 
          spellcheck="false" />
        <div className='cardsHolder__button-block'>
          <button 
            className='cardsHolder__button'
            onClick={showTranslation}>
              Показать слово
          </button>
          <button 
            className='cardsHolder__button'
            onClick={nextWord1}>
              Следующая
          </button>
        </div>
      </div>
      {currentWord && currentWord !== null && currentWord.word === 'Правда все.' &&
      <div className="cardsHolder__arrow-container" onClick={repeatAgain}>
        <img 
          src={arrow1} 
          alt="Стрелка назад" 
          className='cardsHolder__arrow1'
        />
        <p className="deckItem__text">Повторять снова</p>
      </div>}
      {
      <div className="cardsHolder__arrow-container" onClick={stopRepeating}>
        <img 
          src={arrow} 
          alt="Стрелка назад" 
          className='deckItem__arrow'
        />
        <p className="deckItem__text">Назад к теме</p>
      </div>}



          {!repeatMode && cardsAreVisible && 
            <div className="deckItem__arrow-container" onClick={handleCloseModesClick}>
              <img 
                src={arrow} 
                alt="Стрелка назад" 
                className='deckItem__arrow'
              />
              <p className="deckItem__text">Назад к теме</p>
            </div>
          }
        </section>
      </main>
      <Footer />
    </>
  );
}  

export default NumbersTrainPage;
